static uint8_t lcdkit_panel_init(uint32_t product_id, char* compatible)
{
    uint8_t lcd_panel_id = DEFAULT_AUO_OTM1901A_5P2_1080P_VIDEO_DEFAULT_PANEL;
    int i = 0;
    int len = strlen(compatible);
    int length = 0;
    for (i = 0; i < ARRAY_SIZE(lcdkit_map); ++i) {
        length = strlen(lcdkit_map[i].panel_compatible);
        if ((lcdkit_map[i].product_id == product_id) && !strncmp(lcdkit_map[i].panel_compatible, compatible, (length > len?length:len))){
            lcd_panel_id = lcdkit_map[i].lcd_id;
            break;
        }
    }

    HISI_FB_INFO("lcd_panel_id = %d\n", lcd_panel_id);
    return lcd_panel_id;
}


